import React from "react";
import { Link } from "react-router-dom";

const Login = () => {
  return (
    <div className="auth">
      <h1>Login</h1>
      <form>
        <input type="text" placeholder="username" />
        <input type="password" placeholder="password" />
        <button>login</button>
        <span>
          계정이 없으신가요?<Link to="/register">가입하기</Link>
        </span>
      </form>
    </div>
  );
};

export default Login;
